MultiLanguageSpellData['en'][84424] = {name = "Invisibility Field", additional_info = "5 sec cast\nRequires Belt\nTools: Arclight Spanner\nReagents:\nHandful of Obsidium Bolts , Electrified Ether\n[q]Permanently attaches thousands of tiny mirrors to your belt, allowing you to turn invisible while out of combat. Can be activated once every 5 min.\n\n Can only be used on your own belt, and doing so will cause it to become soulbound. Requires at least 500 skill in Engineering to use."}
