MultiLanguageSpellData['en'][86470] = {name = "Mastery", additional_info = "[q]Allows you to benefit from mastery rating.\n\nStarsurge\nTotal Eclipse\n Increases the bonus damage from Eclipse by 16%. Each point of Mastery increases the bonus by an additional 2.0%\n\n\n\nMangle\nSavage Defender\n Increases the damage absorbed by your Savage Defense ability by 32%. Each point of Mastery increases the absorb by an additional 4%.\n\nRazor Claws\n Increases damage done by your Cat Form bleed abilities by 25%. Each point of Mastery increases bleed damage by an additional 3.1%\n\n\n\nSwiftmend\nHarmony\n Your direct healing is increased by an additional 10% and casting your direct healing spells grants you an additional 10% bonus to periodic healing for 10 sec. Each point of Mastery increases each bonus by an additional 1.25%\n\n Select a talent specialization in order to activate the bonus from mastery rating. Consult your talent overview pane for additional information."}
MultiLanguageSpellData['en'][86471] = {name = "Mastery", additional_info = "[q]Allows you to benefit from mastery rating.\n\nHeart Strike\nBlood Shield\n Each time you heal yourself with Death Strike while in Blood Presence, you gain 50% of the amount healed as a damage absorption shield. Each point of Mastery increases the shield by an additional 6.25%\n\n\n\nFrost Strike\nFrozen Heart\n Increases all Frost damage done by 16%. Each point of Mastery increases Frost damage by an additional 2.0%\n\n\n\nScourge Strike\nDreadblade\n Increases all Shadow damage done by 20%. Each point of Mastery increases Shadow damage by an additional 2.5%\n\n Select a talent specialization in order to activate the bonus from mastery rating. Consult your talent overview pane for additional information."}
MultiLanguageSpellData['en'][86472] = {name = "Mastery", additional_info = "[q]Allows you to benefit from mastery rating.\n\nIntimidation\nMaster of Beasts\n Increases the damage done by your pets by 13.4%. Each point of Mastery increases pet damage by an additional 1.67%\n\n\n\nAimed Shot\nWild Quiver\n Grants a 16.8% chance for your ranged attacks to also instantly fire an additional ranged shot. Each point of Mastery increases the chance by an additional 2.1%\n\n\n\nExplosive Shot\nEssence of the Viper\n Increases all magical damage you deal by 8%. Each point of Mastery increases magical damage by an additional 1.0%\n\n Select a talent specialization in order to activate the bonus from mastery rating. Consult your talent overview pane for additional information."}
MultiLanguageSpellData['en'][86473] = {name = "Mastery", additional_info = "[q]Allows you to benefit from mastery rating.\n\nArcane Barrage\nMana Adept\n Increases all spell damage done by up to 12%, based on the amount of mana the Mage has unspent. Each point of Mastery increases damage done by up to an additional 1.5%\n\n\n\nPyroblast\nFlashburn\n Increases the damage done by all your periodic fire damage effects by 22.4%. Each point of Mastery increases periodic damage done by an additional 2.8%\n\n\n\nSummon Water Elemental\nFrostburn\n All your spells deal 20% increased damage against Frozen targets. Each point of Mastery increases damage by an additional 2.5%\n\n Select a talent specialization in order to activate the bonus from mastery rating. Consult your talent overview pane for additional information."}
MultiLanguageSpellData['en'][86474] = {name = "Mastery", additional_info = "[q]Allows you to benefit from mastery rating.\n\nHoly Shock\nIlluminated Healing\n Your direct healing spells also place an absorb shield on your target for 12% of the amount healed, lasting 15 sec. Each point of Mastery increases the absorb amount by an additional 1.50%\n\n\n\nAvenger's Shield\nDivine Bulwark\n Increases your chance to block melee attacks by 18%. Each point of Mastery increases block chance by an additional 2.25%\n\n\n\nTemplar's Verdict\nHand of Light\n Your Templar's Verdict, Crusader Strike, and Divine Storm deal 16.8% additional damage as Holy damage. Each point of Mastery increases the damage by an additional 2.1%\n\n Select a talent specialization in order to activate the bonus from mastery rating. Consult your talent overview pane for additional information."}
MultiLanguageSpellData['en'][86475] = {name = "Mastery", additional_info = "[q]Allows you to benefit from mastery rating.\n\nPenance\nShield Discipline\n Increases the potency of all your damage absorption spells by 20%. Each point of Mastery increases the potency of absorbs by an additional 2.5%\n\n\n\nHoly Word: Chastise\nEcho of Light\n Your direct healing spells heal for an additional 10% over 6 sec. Each point of Mastery provides an additional 1.25% healing over 6 sec\n\n\n\nMind Flay\nShadow Orb Power\n Increases the damage done by your Shadow Orbs by an additional 11.6%. Each point of Mastery increases damage by an additional 1.45%\n\n Select a talent specialization in order to activate the bonus from mastery rating. Consult your talent overview pane for additional information."}
MultiLanguageSpellData['en'][86476] = {name = "Mastery", additional_info = "[q]Allows you to benefit from mastery rating.\n\nMutilate\nPotent Poisons\n Increases the damage done by your poisons by 28%. Each point of Mastery increases damage by an additional 3.5%\n\n\n\nBlade Flurry\nMain Gauche\n Your main hand attacks have a 16% chance to grant you an attack that deals damage equal to 100% of a main hand attack. Each point of Mastery increases the chance by an additional 2.00%\n\n\n\nShadowstep\nExecutioner\n Increases the damage done by all your finishing moves, and the effectiveness of your Slice and Dice, by 20%. Each point of Mastery increases damage by an additional 0.1%\n\n Select a talent specialization in order to activate the bonus from mastery rating. Consult your talent overview pane for additional information."}
MultiLanguageSpellData['en'][86477] = {name = "Mastery", additional_info = "[q]Allows you to benefit from mastery rating.\n\nThunderstorm\nElemental Overload\n Grants a 16% chance for Elemental Overload to occur, causing your Lightning Bolt, Chain Lightning, or Lava Burst spell to trigger a copy of that spell on the same target that costs no mana and causes 75% of normal damage and no threat. Each point of Mastery increases the chance of Elemental Overload by an additional 2%\n\n\n\nLava Lash\nEnhanced Elements\n Increases Fire, Frost, and Nature damage done by 20%. Each point of Mastery increases damage by an additional 2.5%\n\n\n\nEarth Shield\nDeep Healing\n Increases the power of your direct healing spells by up to 24%, based on the current health of your target (lower health targets are healed for more). Each point of Mastery increases direct heals by up to 3.0%\n\n Select a talent specialization in order to activate the bonus from mastery rating. Consult your talent overview pane for additional information."}
MultiLanguageSpellData['en'][86478] = {name = "Mastery", additional_info = "[q]Allows you to benefit from mastery rating.\n\nUnstable Affliction\nPotent Afflictions\n Increases all periodic shadow damage you deal by 13%. Each point of Mastery increases periodic shadow damage by an additional 1.63%\n\n\n\nSummon Felguard\nMaster Demonologist\n Increases the damage done by your demon servants and damage you deal while transformed into a demon by 18.4%. Each point of Mastery increases damage by an additional 2.3%\n\n\n\nConflagrate\nFiery Apocalypse\n Increases all fire damage you deal by 10.8%. Each point of Mastery increases fire damage by an additional 1.35%\n\n Select a talent specialization in order to activate the bonus from mastery rating. Consult your talent overview pane for additional information."}
MultiLanguageSpellData['en'][86479] = {name = "Mastery", additional_info = "[q]Allows you to benefit from mastery rating.\n\nMortal Strike\nStrikes of Opportunity\n Your Mastery grants a 17.6% chance for your melee attacks to instantly trigger an additional melee attack for 100% normal damage. Each point of Mastery increases this chance by 2.2%\n\n\n\nBloodthirst\nUnshackled Fury\n Your Mastery increases the benefit of abilities that cause or require you to be enraged by 44.8%. Each point of Mastery increases enrage effects by 5.60%\n\n\n\nShield Slam\nCritical Block\n Your Mastery increases your chance to block by 12% and your chance to critically block by 12%. Each point of Mastery increases your block chance by 1.5% and your chance to critically block by 1.5%\n\n Select a talent specialization in order to activate Mastery. Consult your talent overview pane for additional information."}
