MultiLanguageSpellData['en'][89890] = {name = "[q0]Eerie Smolderthorn Idol", additional_info = "3 sec cast 5\n[q]When the high elves went to war with the Amani trolls, the elves could not understand how the trolls' weapon enchantments were more powerful than their own. The elves then stole ancient knowledge from troll spellcasters, including the famous Zanza, and used idols such as this one to craft their own versions of the troll enchantments.\n[q0]Eerie Smolderthorn Idol\nBinds when picked up"}
MultiLanguageSpellData['en'][89891] = {name = "[q0]Cinnabar Bijou", additional_info = "3 sec cast 5\n[q]This small token was formed from a volcanic - and toxic - red mineral. The inscription on the reverse states that it was once the property of Min'loth the Serpent. Traces of barnacles suggest that the bijou has spent time underwater.\n[q0]Cinnabar Bijou\nBinds when picked up"}
