MultiLanguageSpellData['en'][89893] = {name = "[q0]Coin from Eldre'Thalas", additional_info = "3 sec cast 5\n[q]Once a Highborne capital, the city of Queen Azshara's arcanists fell into decay and ultimately depravity following the Great Sundering. The ruin is now known as Dire Maul.\n[q0]Coin from Eldre'Thalas\nBinds when picked up"}
MultiLanguageSpellData['en'][89894] = {name = "[q0]Shattered Glaive", additional_info = "3 sec cast 5\n[q]This is a fragment of a large, three-bladed projectile fired from elven siege weapons. While glaive throwers are common even today, this fragment is of an ancient design with detailed ornamentation, even by night elf standards.\n[q0]Shattered Glaive\nBinds when picked up"}
MultiLanguageSpellData['en'][89895] = {name = "[q0]Twisted Ammonite Shell", additional_info = "3 sec cast 5\n[q]Ammonites are an extinct type of shelled squid. The shell could be long like a spear or coiled in a variety of different ways. While this fossil is of a small specimen, they could grow quite large.\n[q0]Twisted Ammonite Shell\nBinds when picked up"}
MultiLanguageSpellData['en'][89896] = {name = "[q0]Green Dragon Ring", additional_info = "3 sec cast 5\n[q]This is likely a representation of Eranikus, consort of Ysera. Eranikus was lost to the corruption of the Emerald Nightmare and later redeemed. Along the inside of the ring is inscribed, 'Andu-falah-dor!'\n[q0]Green Dragon Ring\nBinds when picked up"}
