MultiLanguageSpellData['en'][90411] = {name = "[q0]Bodacious Door Knocker", additional_info = "3 sec cast 5\n[q]You can only imagine what type of residence or business this artifact once adorned. This, er... knocker is in the shape of a buxom female dwarf with a gap-toothed smile, cheerfully bearing multiple pints.\n[q0]Bodacious Door Knocker\nBinds when picked up"}
MultiLanguageSpellData['en'][90412] = {name = "[q0]Boot Heel with Scrollwork", additional_info = "3 sec cast 5\n[q]The attention to detail in this simple boot heel suggests that the original piece of footwear might have been magical. The ornamentation is largely abstract, but you can make out small woodland animals- squirrels, deer, perhaps a skunk - hidden within all the scrollwork and stylized knots.\n[q0]Boot Heel with Scrollwork\nBinds when picked up"}
MultiLanguageSpellData['en'][90413] = {name = "[q0]Golden Chamber Pot", additional_info = "3 sec cast 5\n[q]Apparently the rich and famous do all of their business in style. This piece is decorated with leaping fish and a running stream.\n[q0]Golden Chamber Pot\nBinds when picked up"}
