MultiLanguageSpellData['en'][90419] = {name = "[q0]Ironstar's Petrified Shield", additional_info = "3 sec cast 5\n[q]According to legend, Thane Ironstar of the Dark Iron dwarves carved this shield from a sacred high elven tree and then enchanted the item to turn it hard as stone.\n[q0]Ironstar's Petrified Shield\nBinds when picked up"}
MultiLanguageSpellData['en'][90420] = {name = "[q0]Skull-Shaped Planter", additional_info = "3 sec cast 5\n[q]Forest trolls have a strong affinity for plant life. The trolls' bodies themselves can support simple vegetation, such as moss or algae, which gives them their characteristic green color.\n[q0]Skull-Shaped Planter\nBinds when picked up"}
MultiLanguageSpellData['en'][90421] = {name = "[q0]Bracelet of Jade and Coins", additional_info = "3 sec cast 5\n[q]This bracelet was made by connecting troll coins and polished bits of jade with a silver chain. Since trolls tend to prefer gold in their jewelry, it's possible the silver was captured from another race, which would make this piece of more recent origin. The coins are unusual and depict the leering faces of a series of lady trolls.\n[q0]Bracelet of Jade and Coins\nBinds when picked up"}
