MultiLanguageSpellData['en'][90423] = {name = "[q0]Gahz'rilla Figurine", additional_info = "3 sec cast 5\n[q]The sand trolls summoned this huge, white hydra from a sacred pool within Zul'Farrak and then proceeded to worship it as a god. Gahz'rilla's scales are electrified, and even this small figurine seems alive with energy. Within Zul'Farrak, the legendary hydra is a common motif in architecture and ornamentation.\n[q0]Gahz'rilla Figurine\nBinds when picked up"}
