MultiLanguageSpellData['en'][90429] = {name = "[q0]Atal'ai Scepter", additional_info = "3 sec cast 5\n[q]'Atal'ai' means 'devoted ones' in Zandali, and this twisted group of trolls was devoted to the blood god, Hakkar: a being of extreme malevelonce who recently tasted defeat in Zul'Gurub, ancient capital of the Gurubashi empire. This scepter is decorated with a bat motif, possibly a connection to Hir'eek, the primal bat god.\n[q0]Atal'ai Scepter\nBinds when picked up"}
