MultiLanguageSpellData['en'][90432] = {name = "[q0]Devilsaur Tooth", additional_info = "3 sec cast 5\n[q]Devilsaurs are among the largest predators to ever walk Azeroth. While most died out long ago, some thrive in isolated pockets to this day. There is much speculation about the purpose of the devilsaur's degenerate front arms. One theory is that they help devilsaurs rise to a standing position; another theory suggests that the arms titillate females. More observation is necessary.\n[q0]Devilsaur Tooth\nBinds when picked up"}
