MultiLanguageSpellData['en'][90451] = {name = "[q0]Kaldorei Amphora", additional_info = "3 sec cast 5\n[q]This slender vase with two looping handles was used to mix or store Darnassian wine. Even after all this time, you can still detect a faint scent of ginger from the dried residue at the bottom of this vessel.\n[q0]Kaldorei Amphora\nBinds when picked up"}
MultiLanguageSpellData['en'][90452] = {name = "[q0]Ancient Shark Jaws", additional_info = "3 sec cast 5\n[q]Sharks have no true bones, only cartilage. Because their feeding habits involve biting things with a great deal of force, losing teeth is common. Therefore, sharks have multiple rows of teeth which they replace constantly throughout their lifetimes.\n[q0]Ancient Shark Jaws\nBinds when picked up"}
MultiLanguageSpellData['en'][90453] = {name = "[q0]Hairpin of Silver and Malachite", additional_info = "3 sec cast 5\n[q]Engraved beneath the setting for the precious stone are the words 'To Theleste, on her twenty-fourth birth year.'\n[q0]Hairpin of Silver and Malachite\nBinds when picked up"}
