MultiLanguageSpellData['en'][90458] = {name = "[q0]Delicate Music Box", additional_info = "3 sec cast 5\n[q]This box is of sandalwood with a tiny clockwork elf and nightsaber within. Although the winding mechanism is no longer functional, you can imagine the two would dance together while music played. Engraved on the bottom: 'To my dearest Theleste.'\n[q0]Delicate Music Box\nBinds when picked up"}
