MultiLanguageSpellData['en'][90464] = {name = "[q3]Highborne Soul Mirror", additional_info = "3 sec cast 15\n[q]Before the Great Sundering, the Highborne were known among the night elves for their arrogance, avarice and outlandish clothing. It was said that nothing was so pleasing to the gaze of the Highborne as themselves. These mirrors were created so that elven ladies could see their colorful garments in three full dimensions, yet the reflection often exaggerated the already depraved visage of the viewer.\n[q3]Highborne Soul Mirror\nBinds when picked up\nToy\n[q2]Use: Look into the mirror... (10 Min Cooldown)"}
