MultiLanguageSpellData['en'][90493] = {name = "[q3]Druid and Priest Statue Set", additional_info = "3 sec cast 15\n[q]It was a tremendous societal change when night elf men were allowed to become priests and the women druids. For thousands of years previously, the two roles had been exclusive to the other gender. This pair of statues commemorates those momentous and tumultuous events.\n[q3]Druid and Priest Statue Set\nBinds when picked up\nToy\n[q2]Use: Summon a Fountain of Knowledge. (15 Min Cooldown)"}
