MultiLanguageSpellData['en'][90504] = {name = "[q0]Dented Shield of Horuz Killcrow", additional_info = "3 sec cast 5\n[q]The grave mistake made by Horuz when he and his companions fought the great wyrm Kaldrigos cost the storied warrior his life. He stood directly behind the dragon. Never do that.\n[q0]Dented Shield of Horuz Killcrow\nBinds when picked up"}
MultiLanguageSpellData['en'][90505] = {name = "Item - Shaman T11 Elemental 4P Bonus", additional_info = "[q]Reduces the cast time of your Lightning Bolt spell by 10%."}
MultiLanguageSpellData['en'][90506] = {name = "[q0]Scorched Staff of Shadow Priest Anund", additional_info = "3 sec cast 5\n[q]This wooden staff has been thoroughly blackened by arcane breath. Such was the fate of its wielder as well.\n[q0]Scorched Staff of Shadow Priest Anund\nBinds when picked up"}
