MultiLanguageSpellData['en'][90509] = {name = "[q0]Scepter of Charlga Razorflank", additional_info = "3 sec cast 5\n[q]Although these artifact fragments were found intermingled with those of dwarves, this scepter is clearly not of dwarven manufacture, but was made by quilboar. In fact, it was once wielded by Charlga Razorflank herself. Perhaps it came into dwarven possession when heroes attempted to conquer Razorfen Kraul.\n[q0]Scepter of Charlga Razorflank\nBinds when picked up"}
