MultiLanguageSpellData['en'][90518] = {name = "[q0]Mithril Chain of Angerforge", additional_info = "3 sec cast 5\n[q]The Angerforge family has a long lineage in Dark Iron dwarf history. This is a chain worn by Thane Angerforge, the ancestor of General Angerforge, who still commands the Dark Iron armies of Blackrock Depths.\n[q0]Mithril Chain of Angerforge\nBinds when picked up"}
MultiLanguageSpellData['en'][90519] = {name = "[q0]Skull Staff of Shadowforge", additional_info = "3 sec cast 5\n[q]The Shadowforge family has left a long stain on Dark Iron history. Iron Thane Shadowforge was by all accounts a cruel despot who tortured and killed many of his own people. While it is generally held that he was a warlock, some accounts cling to the rumor that he was one of the first dwarven shaman.\n[q0]Skull Staff of Shadowforge\nBinds when picked up"}
MultiLanguageSpellData['en'][90520] = {name = "Arcane Overload", additional_info = nil}
MultiLanguageSpellData['en'][90521] = {name = "[q3]Clockwork Gnome", additional_info = "3 sec cast 15\n[q]Mechagnomes were created by the titans, apparently as servants and caretakers, much like the earthen. This mechagnome was likely damaged because it is no longer focused on its original tasks and seems content to follow you.\n[q3]Clockwork Gnome\nBinds when picked up\n[q2]Use: Teaches you how to summon this companion.\n[q2]Right Click to summon and dismiss your Clockwork Gnome."}
