MultiLanguageSpellData['en'][90551] = {name = "Overwhelming Power", additional_info = "100 yd range\n5 sec cast\n[q]Sends out an arc of magic, inflicting Arcane damage to the target enemy."}
MultiLanguageSpellData['en'][90553] = {name = "[q3]Chalice of the Mountain Kings", additional_info = "3 sec cast 15\n[q]In addition to the many jewels adorning it, this chalice is virtually covered with runes celebrating an old ascension ceremony for dwarven kings. Drinking from this chalice was certainly a part of it, but the runes go on to describe a 'sword dance' done by female dwarven warriors. This performance, part ritual and part mock battle, apparently evolved from bloody duels fought during less sophisticated times in dwarven history.\n[q3]Chalice of the Mountain Kings\nBinds when picked up\nToy\n[q2]Use: Witness a historic sword dance. (10 Min Cooldown)"}
