MultiLanguageSpellData['en'][90581] = {name = "[q0]Drakkari Sacrificial Knife", additional_info = "3 sec cast 5\n[q]The Drakkari tribe was driven north by other trolls and eventually settled in Northrend, where they survived the harsh elements to establish their own nation. The arrival of the Lich King was a great threat to the Drakkari. One of their least sensible attempts to fight off the Lich King was to begin sacrificing their own animal gods: the serpent, snow leopard, bear, wind serpent, mammoth and rhino.\n[q0]Drakkari Sacrificial Knife\nBinds when picked up"}
