MultiLanguageSpellData['en'][90608] = {name = "[q4]Zin'rokh, Destroyer of Worlds", additional_info = "3 sec cast 15\n[q]According to your research, this great weapon was one of the many treasures of Hakkar the Soulflayer in Zul'Gurub. Hakkar was defeated years ago, and this sword passed through the hands of many powerful warriors and paladins before apparently becoming sundered. It is remarkable that you have been able to reforge it, but also a little troubling: if the Destroyer of Worlds has returned, perhaps the Soulflayer is not far behind.\n[q4]Zin'rokh, Destroyer of Worlds\nBinds to account\nUniqueTwo-Hand Sword\n1,894 - 2,842 Damage Speed 3.80\n(623.16 damage per second)\n+341 Strength\n+512 Stamina\nDurability 120 / 120\n85\n[q2]Equip: Improves critical strike rating by 238.\n[q2]Equip: Improves hit rating by 216."}
MultiLanguageSpellData['en'][90609] = {name = "[q0]String of Small Pink Pearls", additional_info = "3 sec cast 5\n[q]While individually these pearls are not particularly large, it is notable how all forty-two of them appear to be virtually identical. Rather than the opalescent white or even the rare black of typical oyster pearls, these are a rosy pink in color. A scallop shell completes the piece.\n[q0]String of Small Pink Pearls\nBinds when picked up"}
MultiLanguageSpellData['en'][90610] = {name = "[q0]Chest of Tiny Glass Animals", additional_info = "3 sec cast 5\n[q]Remarkably, you managed to find an entire menagerie of these elven glass animals in their original storage container. While some of the animals have understandably suffered cracks and chips, it is clear that the head of the stag has been deliberately severed. The initial 'T' is carved on the bottom of the chest.\n[q0]Chest of Tiny Glass Animals\nBinds when picked up"}
MultiLanguageSpellData['en'][90611] = {name = "[q0]Cracked Crystal Vial", additional_info = "3 sec cast 5\n[q]A note in rich vellum is tied to the bottle. 'Dearest P, now that I know we can never be together, it is my wish to drink this draught of spider venom. If this note finds you, my hope is that you might do the same. May Elune watch over our souls.'\n[q0]Cracked Crystal Vial\nBinds when picked up"}
MultiLanguageSpellData['en'][90612] = {name = "[q0]Scepter of Xavius", additional_info = "3 sec cast 5\n[q]Xavius was responsible for many of the evils that befell the night elf people during the War of the Ancients. Malfurion Stormrage was ultimately able to foil Xavius, destroying him in the process. Afterwards, Sargeras tortured Xavius' spirit for a time before finally bestowing upon him the twisted form of the first satyr.\n[q0]Scepter of Xavius\nBinds when picked up"}
MultiLanguageSpellData['en'][90614] = {name = "[q3]Kaldorei Wind Chimes", additional_info = "3 sec cast 15\n[q]These chimes are composed of a series of richly decorated bronze tubes of varying lengths connected to a strand of bronze designed to appear as a vine. This artifact is magical, and the chimes appear to play music of their own accord, even when there is no wind.\n[q3]Kaldorei Wind Chimes\nBinds when picked up\nToy\n[q2]Use: Hold the chimes up to the wind and check the weather. (1 Min Cooldown)"}
MultiLanguageSpellData['en'][90615] = {name = "Fourth and Goal: Character Earthquake", additional_info = nil}
MultiLanguageSpellData['en'][90616] = {name = "[q4]Queen Azshara's Dressing Gown", additional_info = "3 sec cast 15\n[q]That Azshara was the most beautiful of night elves is practically regarded as fact. Unfortunately, her own eye for beauty seems to have been as limited as that of many of her brethren, at least judging from the garish colors of this gown. 'There has only ever been, only ever will be... one Azshara.'\n[q4]Queen Azshara's Dressing Gown\nBinds to account\nChest Cloth\n258 Armor\n+27 Stamina\n+41 Intellect\nDurability 165 / 165\n51\n[q2]Equip: Improves haste rating by 23.\n[q]\"The rumors of the Highborne's poor fashion sense seem to be true.\""}
MultiLanguageSpellData['en'][90617] = {name = "[q0]Feathered Raptor Arm", additional_info = "3 sec cast 5\n[q]Among the Explorers' League, there are those who believe that birds are descended from dinosaurs such as this raptor. The feathers suggest some kind of missing link between the two different kinds of animals. Alternatively, this creature could just be one of the many strange monsters which infest Azeroth.\n[q0]Feathered Raptor Arm\nBinds when picked up"}
MultiLanguageSpellData['en'][90618] = {name = "[q0]Vicious Ancient Fish", additional_info = "3 sec cast 5\n[q]This fish skeleton is protected by heavy plates of bone, and the jaws are lined with hundreds of needle-like teeth. There are those who believe that oceans once covered all of the continents, allowing fish fossils to be found in locations hundreds of miles inland.\n[q0]Vicious Ancient Fish\nBinds when picked up"}
MultiLanguageSpellData['en'][90619] = {name = "[q4]Fossilized Raptor", additional_info = "3 sec cast 15\n[q]When you finished assembling this skeleton through some eldritch magic, the creature sprang back to life.\n[q4]Fossilized Raptor\nBinds when picked up\nMount\n40\nRequires\n[q2]Use: Teaches you how to summon this mount.\n[q2]Summons and dismisses a rideable Fossilized Raptor."}
