MultiLanguageSpellData['en'][90831] = {name = "[q0]Fiendish Whip", additional_info = "3 sec cast 5\n[q]Warlocks rose to prominence among the orcs as Gul'dan rose to power. This succubus whip is formed of the plaited flesh of several different creatures, some of them likely humanoid.\n[q0]Fiendish Whip\nBinds when picked up"}
MultiLanguageSpellData['en'][90832] = {name = "[q0]Tile of Glazed Clay", additional_info = "3 sec cast 5\n[q]There must have once been many of these tiles decorating the walls or floor of a Draenor fortress or stateroom. The tile depicts herd animals in a field of green and yellow glaze, much like Nagrand looks today. The border is a checkerboard of black and brown.\n[q0]Tile of Glazed Clay\nBinds when picked up"}
