MultiLanguageSpellData['en'][90843] = {name = "[q4]Headdress of the First Shaman", additional_info = "3 sec cast 15\n[q]The origin of shamanism among the orcs remains a mystery. As far back as orcish history has been recorded, shaman have been mentioned. This simple headdress seems ancient beyond time. Its creator and original wearer have been lost to history.\n[q4]Headdress of the First Shaman\nBinds to account\nHead Mail\n720 Armor\n+39 Agility\n+21 Stamina\n\n[q0]Red Socket\n[q0]Blue Socket\n[q0]Yellow Socket\n[q0]Socket Bonus: +6 Stamina\n\nDurability 100 / 100\n61\n[q2]Equip: Improves critical strike rating by 22.\n[q2]Equip: Improves hit rating by 22.\n[q2]Use: Allows you to see far into the distance. (1 Min Cooldown)"}
