MultiLanguageSpellData['en'][90853] = {name = "[q0]Anklet with Golden Bells", additional_info = "3 sec cast 5\n[q]This slim loop of purple metal is adorned with seventeen tiny bells and larger yellow beads of blown glass. It might have been worn by a dancer or a young socialite.\n[q0]Anklet with Golden Bells\nBinds when picked up"}
