MultiLanguageSpellData['en'][90860] = {name = "[q0]Carved Harp of Exotic Wood", additional_info = "3 sec cast 5\n[q]This small harp was held in one hand, like a lyre. It has a deep wooden sounding box with seven strings knotted around a tuning bar. It is capable of playing music, but seems to only produce sad, melancholy notes.\n[q0]Carved Harp of Exotic Wood\nBinds when picked up"}
MultiLanguageSpellData['en'][90861] = {name = "[q0]Strange Silver Paperweight", additional_info = "3 sec cast 5\n[q]If this object was not used as a draenei paperweight, then you have no idea of its function. It appears to be a blob of petrified mercury with one flat side so that it can sit on a desk.\n[q0]Strange Silver Paperweight\nBinds when picked up"}
