MultiLanguageSpellData['en'][90968] = {name = "[q0]Baroque Sword Scabbard", additional_info = "3 sec cast 5\n[q]This sword sheath is almost distasteful in its ornamentation. Every bit of exposed surface has been carved, gilded or inscribed upon. It is likely the weapon this scabbard once carried was highly magical or ceremonial in nature.\n[q0]Baroque Sword Scabbard\nBinds when picked up"}
