MultiLanguageSpellData['en'][90974] = {name = "[q0]Fine Crystal Candelabra", additional_info = "3 sec cast 5\n[q]This piece once held a full dozen candles. It is virtually dripping with blue and purple crystals connected by fine chains and ornate scrollwork. The artisan's initials are engraved on the bottom: 'V. T.'\n[q0]Fine Crystal Candelabra\nBinds when picked up"}
MultiLanguageSpellData['en'][90975] = {name = "[q0]Dignified Portrait", additional_info = "3 sec cast 5\n[q]This is a very serious oil painting of a very serious draenei gentleman. While the artwork overall is flattering, you get the sense that the artist thought his subject was quite the jerk, because you can see at the very bottom edge of the frame that the gentleman was not painted wearing pants.\n[q0]Dignified Portrait\nBinds when picked up"}
