MultiLanguageSpellData['en'][90983] = {name = "[q3]Arrival of the Naaru", additional_info = "3 sec cast 15\n[q]This crystal seems to be a magical recording device of some sort. The message it plays is in a language you can't entirely decipher, but you gather it is either a recording or a recreation of the first meeting of the eredar and the naaru.\n[q3]Arrival of the Naaru\nBinds when picked up\nToy\n[q2]Use: Witness a recording of the arrival of the naaru. (3 Min Cooldown)"}
MultiLanguageSpellData['en'][90984] = {name = "[q3]The Last Relic of Argus", additional_info = "3 sec cast 15\n[q]Before they lived on Azeroth or Draenor, the draenei, who still called themselves the eredar at the time, lived on Argus. When Sargeras took notice of Argus, Prophet Velen fled with some of his people, who became the draenei. The remaining eredar were absorbed into the Burning Legion. This simple crystal was taken from Argus when Velen fled. The inscription on the bottom reads, 'I long for Mac'Aree.'\n[q3]The Last Relic of Argus\nBinds when picked up\n[q2]Use: Teleports you exactly where you want to go... if you aren't too picky. (12 Hrs Cooldown)\n[q]\"One of the few things the draenei were able to take with them on their flight from Argus.\""}
MultiLanguageSpellData['en'][90985] = {name = "Dead Winds", additional_info = "Instant\n[q]Spell Power increased by 17 for 15 sec."}
MultiLanguageSpellData['en'][90986] = {name = "Item - Proc Stacking Spell Power", additional_info = "[q]Your healing and damage periodic spells grant 17 spell power each time they heal or deal damage.  Lasts 15 sec, stacking up to 20 times.\n(500ms cooldown)"}
MultiLanguageSpellData['en'][90987] = {name = "[q0]Plated Elekk Goad", additional_info = "3 sec cast 5\n[q]Elekk are mammoth-like creatures native to Draenor, particularly the Nagrand area. The draenei domesticated elekk for use as mounts. This goad is a long pointed stick used for motivating surly elekk that haven't completed their training.\n[q0]Plated Elekk Goad\nBinds when picked up"}
MultiLanguageSpellData['en'][90988] = {name = "[q0]Intricate Treasure Chest Key", additional_info = "3 sec cast 5\n[q]While vrykul technology in general is slightly behind that of the Horde or Alliance, the detail of the design on this simple key is astounding. In vrykul culture, it is the woman of the household who keeps all the keys, often displaying them prominently to show her status. 'Does not open Dark Cleric Salem's chest.'\n[q0]Intricate Treasure Chest Key\nBinds when picked up"}
