MultiLanguageSpellData['en'][91214] = {name = "[q4]Blessing of the Old God", additional_info = "3 sec cast 15\n[q]Pwhn'guul i ghawl'fwata ryiu wgah uul'gwan h'iwn guu'lal. Pwhn'guul i ghawl'fwata ryiu wgah uul'gwan h'iwn guu'lal. Pwhn'guul i ghawl'fwata ryiu wgah uul'gwan h'iwn guu'lal.\n[q4]Blessing of the Old God\nBinds when picked up\nToy\n[q2]Use: Receive the Blessing of the Old God for 20 sec. (10 Min Cooldown)"}
MultiLanguageSpellData['en'][91215] = {name = "[q4]Puzzle Box of Yogg-Saron", additional_info = "3 sec cast 15\n[q]This small box has many shifting panels, moving hinges and hidden clasps. Yet no matter how you manipulate them, it seems impossible to actually open the box to reveal the contents within. It is also difficult to even try because the dark artifact constantly whispers to you, 'It WAS your fault. It WAS your fault. It WAS your fault. It WAS your fault.'\n[q4]Puzzle Box of Yogg-Saron\nBinds when picked up\nToy\n[q2]Use: Make a vain attempt to open the puzzle box. (1 Min Cooldown)\n[q]\"Extremely difficult to open.\""}
