MultiLanguageSpellData['en'][91219] = {name = "[q0]Silver Kris of Korl", additional_info = "3 sec cast 5\n[q]It is etched with the blood of the dread wyrm Kaldrigos' dying heart.\n[q0]Silver Kris of Korl\nBinds when picked up"}
MultiLanguageSpellData['en'][91220] = {name = "Cowering Roar", additional_info = "1 sec cast\n[q]A loud spine tingling roar erupts, fearing all nearby enemies for 3 sec. Any damage taken by the target will remove the fear."}
MultiLanguageSpellData['en'][91221] = {name = "[q0]Warmaul of Burningeye", additional_info = "3 sec cast 5\n[q]Iron Thane Burningeye delighted in battle. He was known to wield a pair of great warhammers. You have reassembled one, long drained of magic. That means the other may be out there somewhere and possibly still a potent weapon.\n[q0]Warmaul of Burningeye\nBinds when picked up"}
MultiLanguageSpellData['en'][91222] = {name = "Shaken", additional_info = nil}
MultiLanguageSpellData['en'][91223] = {name = "[q0]Spiked Gauntlets of Anvilrage", additional_info = "3 sec cast 5\n[q]Anvilrage was one of the most powerful generals in Blackrock Depths. His flaming anvil insignia is visible on tabards and shields beneath Blackrock to this day. While he no longer lives to command the Dark Iron army, many soldiers still bear his name.\n[q0]Spiked Gauntlets of Anvilrage\nBinds when picked up"}
MultiLanguageSpellData['en'][91224] = {name = "[q0]Word of Empress Zoe", additional_info = "3 sec cast 5\n[q]The Word and the Oath of Empress Zoe were once a pair of powerful magical rings. The ring you have recovered was the Word, which sadly was stripped of its magical properties when it was shattered. The Oath has been lost but may yet endure. The empress herself was a little known Dark Iron ruler. Many dwarves lost their lives humoring her obsession with dragons by attempting to steal their eggs or young.\n[q0]Word of Empress Zoe\nBinds when picked up"}
MultiLanguageSpellData['en'][91225] = {name = "[q0]Scepter of Bronzebeard", additional_info = "3 sec cast 5\n[q]Bronzebeard refers both to a clan of dwarves and to its ruling family. The kings of the High Seat have gone through many scepters during their reigns. By tradition, the king would let certain of his top advisors and allies bear the scepter for a single day. These were rough days for the scepters, which saw the insides of taverns, were dropped off mountaintops, were used to smite troggs and so on.\n[q0]Scepter of Bronzebeard\nBinds when picked up"}
MultiLanguageSpellData['en'][91226] = {name = "[q3]The Innkeeper's Daughter", additional_info = "3 sec cast 15\n[q]According to legend, Bryher Stonekeeper ran a prosperous tavern near Loch Modan. His daughter, Keelin, travelled far from home, eventually developing the kind of reputation that embarrassed her father. Bryher made a deal with a gnome warlock to keep his daughter close to home. The warlock turned Keelin into a hearthstone, so that she would always return to the inn.\n[q3]The Innkeeper's Daughter\nBinds when picked up\nUnique\nToy\n[q2]Use: Returns you to <Hearthstone Location>. Speak to an Innkeeper in a different place to change your home location. (30 Min Cooldown)"}
MultiLanguageSpellData['en'][91227] = {name = "[q4]Staff of Sorcerer-Thane Thaurissan", additional_info = "3 sec cast 15\n[q]Sorcerer-Thane Thaurissan was the leader of the Dark Iron dwarves during the War of the Three Hammers. When he lost Ironforge to the Bronzebeard clan, Thaurissan retreated to the Redridge Mountains and founded a city in his name. In a desperate attempt to defeat his enemies, Thaurissan accidentally summoned the demigod Ragnaros, which resulted in the sorceror-thane's immediate death and the formation of the volcanic peak of Blackrock Mountain.\n[q4]Staff of Sorcerer-Thane Thaurissan\nBinds to account\nTwo-Hand Staff\n1,047 - 1,571 Damage Speed 2.10\n(623.33 damage per second)\n+512 Stamina\n+341 Intellect\nDurability 120 / 120\n85\n[q2]Equip: Improves critical strike rating by 228.\n[q2]Equip: Improves haste rating by 228.\n[q2]Equip: Increases spell power by 1,955."}
