MultiLanguageSpellData['en'][91757] = {name = "[q4]Tyrande's Favorite Doll", additional_info = "3 sec cast 15\n[q]Tyrande Whisperwind is the high priestess of Elune, and with her recent marriage, she is no longer sole ruler of the night elves. She grew up in the ancient city of Suramar, far from the first Well of Eternity, not far from the brothers Malfurion and Illidan Stormrage. Tyrande's idyllic childhood proved to be in sharp contrast to the sorrow and conflict that she would endure later in her life.\n[q4]Tyrande's Favorite Doll\nBinds to account\nUnique-EquippedTrinket\n+321 Intellect\n85\n[q2]Equip: Recaptures 20% of the base mana cost of your spells, and stores it within the doll to be released at a later time. Up to a maximum of 4200 mana can be stored.\n[q2]Use: Releases all mana stored within the doll, causing you to gain that much mana, and all enemies within 15 yards take 1 point of Arcane damage for each point of mana released. (1 Min Cooldown)"}
