MultiLanguageSpellData['en'][91761] = {name = "[q4]Bones of Transformation", additional_info = "3 sec cast 15\n[q]When the first Well of Eternity imploded, it sank the center of kaldorei culture to the bottom of the sea. To escape certain doom, Queen Azshara made a pact with a greater power, possibly an Old God or an elemental. As a result, a curse descended upon the surviving Highborne, who became twisted, serpent-like creatures now known as the naga.\n[q4]Bones of Transformation\nBinds when picked up\nToy\n[q2]Use: Endure the transformation for 20 sec. (10 Min Cooldown)"}
MultiLanguageSpellData['en'][91762] = {name = "[q0]Carcanet of the Hundred Magi", additional_info = "3 sec cast 5\n[q]During the Troll Wars, the elves of Quel'Thalas were nearly defeated by the Amani trolls. In desperation, the elves taught the humans of Arathor the ways of arcane magic. The elves taught only one hundred humans, the bare minimum needed to defeat the trolls. The humans proved to be clumsy spellcasters but had a natural affinity for magic.\n[q0]Carcanet of the Hundred Magi\nBinds when picked up"}
