MultiLanguageSpellData['en'][91764] = {name = "See Invis 11", additional_info = nil}
MultiLanguageSpellData['en'][91765] = {name = "See Invis 12", additional_info = nil}
MultiLanguageSpellData['en'][91766] = {name = "[q0]Silver Scroll Case", additional_info = "3 sec cast 5\n[q]While this elven scroll case is graced with much ornamentation, it is the message inside, written in Darnassian, that is of the most interest: 'Pyramond, under no circumstances are you to spend time with that tavern wench. Your mother and I forbid it. She is far beneath your station.'\n[q0]Silver Scroll Case\nBinds when picked up"}
