MultiLanguageSpellData['en'][91768] = {name = "Summon Agatha", additional_info = nil}
MultiLanguageSpellData['en'][91769] = {name = "[q0]Umbra Crescent", additional_info = "3 sec cast 5\n[q]This is a circular blade favored by night elf Watchers. This type of weapon was most famously wielded by Maiev Shadowsong, but can be seen even today on night elves such as the Barrow Deeps Watchers on Mount Hyjal. It is likely the weapon you have recovered was magical before it was broken into so many fragments.\n[q0]Umbra Crescent\nBinds when picked up"}
