MultiLanguageSpellData['en'][91771] = {name = "Wisp Form", additional_info = "Instant\n[q]Take on wisp form for 20 sec."}
MultiLanguageSpellData['en'][91773] = {name = "[q4]Wisp Amulet", additional_info = "3 sec cast 15\n[q]Wisps are nature spirits thought to be dead night elves. They exist in tight connection with their forest homeland and night elves in general, performing such beneficial activities as construction, repair and defense of elven communities. Many wisps sacrificed themselves in order to defeat Archimonde at the end of the Third War, so there are fewer wisps today than there once were.\n[q4]Wisp Amulet\nBinds when picked up\nToy\n[q2]Use: Take on wisp form for 20 sec. (10 Min Cooldown)"}
MultiLanguageSpellData['en'][91774] = {name = "Signal Flare 01 Kill Credit", additional_info = nil}
MultiLanguageSpellData['en'][91775] = {name = "[q0]Castle of Sand", additional_info = "3 sec cast 5\n[q]This is a small square fortress made of sand. The square towers and sun motif suggest tol'vir architecture, but you haven't seen this exact floor plan anywhere in Uldum. The object is clearly made of sand, not sandstone, so you're unsure what holds it together.\n[q0]Castle of Sand\nBinds when picked up"}
