MultiLanguageSpellData['en'][91779] = {name = "[q0]Cat Statue with Emerald Eyes", additional_info = "3 sec cast 5\n[q]This small clay cat displays a lifelike pose and expression. On the underside is engraved, 'In memory of Chalyx, beloved pet of Emperor Ninjter.'\n[q0]Cat Statue with Emerald Eyes\nBinds when picked up"}
MultiLanguageSpellData['en'][91780] = {name = "[q0]Soapstone Scarab Necklace", additional_info = "3 sec cast 5\n[q]'Presented to Emperor Ninjter on the day he assumed the throne. We expect only greatness in his reign.'\n[q0]Soapstone Scarab Necklace\nBinds when picked up"}
