MultiLanguageSpellData['en'][91782] = {name = "[q0]Tiny Oasis Mosaic", additional_info = "3 sec cast 5\n[q]This small piece of artwork has been pieced together from shattered clay tiles colored in brilliant turquoise, green and sand. 'Our hopes and prayers are to Emperor Ninjter, that he may end the famine and restore glory to the Ramkahen!'\n[q0]Tiny Oasis Mosaic\nBinds when picked up"}
