MultiLanguageSpellData['en'][91785] = {name = "[q0]Engraved Scimitar Hilt", additional_info = "3 sec cast 5\n[q]This scimitar appears more ornamental than functional. Its blade ends after only a few inches, but it does not appear to have seen much use in combat. Carved in loops of script around the pommel and down the hilt can be read the words 'May Emperor Ninjter lead us to victory! Kadesh! Osadi! Satekh!'\n[q0]Engraved Scimitar Hilt\nBinds when picked up"}
