MultiLanguageSpellData['en'][91792] = {name = "[q0]Sketch of a Desert Palace", additional_info = "3 sec cast 5\n[q]These are architectural plans, though the architect apparently dreamed on a very big scale. You are unaware of any structure resembling this palace in modern Uldum, so it is likely the palace was never built. 'Commissioned for Emperor Ninjter.'\n[q0]Sketch of a Desert Palace\nBinds when picked up"}
MultiLanguageSpellData['en'][91793] = {name = "[q0]Pipe of Franclorn Forgewright", additional_info = "3 sec cast 5\n[q]Forgewright was a celebrated architect from the Dark Iron clan. He oversaw the construction of, among other things, the Stonewrought Dam and much of Blackrock Depths. It is said his ghost can still be seen within Blackrock Mountain.\n[q0]Pipe of Franclorn Forgewright\nBinds when picked up"}
