MultiLanguageSpellData['en'][92137] = {name = "[q4]Crawling Claw", additional_info = "3 sec cast 15\n[q]A legend among the tol'vir tells of a wicked djinn whom the Ramkahen sought to destroy. In an attempt to prevent his own death, the djinn tried to transfer his spirit into the body of a monkey. He was slain right in the middle of the transference, and only a fraction of his essence had moved over - only enough to possess the monkey's paw.\n[q4]Crawling Claw\nBinds when picked up\n[q2]Use: Teaches you how to summon this companion.\n[q2]Right Click to summon and dismiss your crawling claw."}
