MultiLanguageSpellData['en'][92139] = {name = "[q4]Staff of Ammunae", additional_info = "3 sec cast 15\n[q]Ammunae is one of the guardians of the Halls of Origination. Like the other constructs within the halls, Ammunae was created to protect the powerful device capable of resetting all life on Azeroth. Each of the keepers has a sphere of influence. Isiset presides over magic; Ammunae, life; Setesh, chaos; and Rajh, the sun.\n[q4]Staff of Ammunae\nBinds to account\nTwo-Hand Staff\n1,196 - 1,795 Damage Speed 2.40\n(623.13 damage per second)\n+512 Stamina\n+341 Intellect\n+247 Spirit\nDurability 120 / 120\n85\n[q2]Equip: Improves critical strike rating by 194.\n[q2]Equip: Increases spell power by 1,955.\n[q]\"Achusenmen osadi djahi kahun Ammunae\""}
