MultiLanguageSpellData['en'][92145] = {name = "[q4]Pendant of the Scarab Storm", additional_info = "3 sec cast 15\n[q]In the reign of Pharaoh Tebhotep a plague of serpents struck the Vir'naal River. Nothing could drive away the reptiles. Then, a second plague appeared, this one of desert scarabs. The scarabs fought the serpents until not a one of either creature was left and peace returned to the land.\n[q4]Pendant of the Scarab Storm\nBinds to account\nToy\n[q2]Use: Summons a storm of peaceful scarabs. (10 Min Cooldown)"}
