MultiLanguageSpellData['en'][92148] = {name = "[q4]Scepter of Azj'Aqir", additional_info = "3 sec cast 15\n[q]The aqir were a race of incredibly evil, expansionistic insects who battled the troll empires for thousands of years. Eventually, the great Azj'Aqir civilization split in half, with Azjol-Nerub in the north, and Ahn'Qiraj in the south. The night elves were able to contain the qiraji for many years until they were awakened again by the Old God C'thun.\n[q4]Scepter of Azj'Aqir\nBinds when picked up\nUnique\nMount\n40\nRequires\n[q2]Use: Teaches you how to summon the Ultramarine Qiraji Battle Tank.\n[q2]Summons and dismisses a rideable Ultramarine Qiraji Battle Tank."}
