MultiLanguageSpellData['en'][98556] = {name = "[q3]Haunted War Drum", additional_info = "3 sec cast 15\n[q]Long ago, the most dedicated of troll war-drummers would allow themselves to be flayed alive in order to provide the hide for their precious instruments. While a troll's incredible natural regeneration allowed one to survive such a grueling ordeal, it was a long and excruciating process that drove many mad with pain. It is said that, if such a war drummer was to be slain while playing such an instrument, his spirit would pass into it...\n[q3]Haunted War Drum\nBinds when picked up\nToy\n[q2]Use: Place and listen to a Haunted War Drum. (30 Min Cooldown)"}
