MultiLanguageSpellData['en'][98569] = {name = "[q3]Vrykyl Drinking Horn", additional_info = "3 sec cast 15\n[q]Contrary to popular belief, vrykul drinking horns were not common drinking vessels. While most drank mead or ale from bowls or cups, only those of great prestige quaffed wine from elaborate horns such as this. Indeed, even the passing of such a vessel to the vrykul in question was a matter of ceremony, usually performed by the highest-ranking female present along with formal declarations of rank and deed.\n[q3]Vrykul Drinking Horn\nBinds when picked up\nToy\n[q2]Use: Quaff of the Vrykul Drinking Horn."}
